import React, { Component } from 'react'
import Empolyee from './Empolyees'

class App extends Component{

  constructor(){
    super()
    this.state=[    
    {name: 'Ali' , age: '23'    },
    {name: 'John' , age: '63'   },
    {name: 'Adam' , age: '24'   },
    {name: 'Noah' , age: '65'   },
    {name: 'Batrick' , age: '71'},
  ]
}


  render(){
    const m = this.state.map((e) => {
      return(

        <Empolyee
        empName_one = {e.name}
        empage = {e.age}
        />

      )
    })
    return(
      <div>
        {m}
      </div>
    )
  }
}


export default App
